package main

import (
	"fmt"
	"strings"
)

func main() {
	fmt.Println(solution(in))
}

type point struct {
	x, y int
}

func solution(data string) int {
	var sum int
	var lines = strings.Split(data, "\n")
	var pts [][]byte

	for _, v := range lines {
		pts = append(pts, []byte(v))
	}

	for y, row := range pts {
		for x, v := range row {
			if v == 'A' {
				sum += check(pts, point{x, y})
			}
		}
	}

	return sum
}

func check(pts [][]byte, p point) int {

	if p.x == 0 || p.x == len(pts)-1 || p.y == 0 || p.y == len(pts[0])-1 {
		return 0
	}

	if pts[p.y+1][p.x+1] == 'M' && pts[p.y-1][p.x+1] == 'M' && pts[p.y-1][p.x-1] == 'S' && pts[p.y+1][p.x-1] == 'S' {
		return 1
	}
	if pts[p.y-1][p.x+1] == 'M' && pts[p.y-1][p.x-1] == 'M' && pts[p.y+1][p.x-1] == 'S' && pts[p.y+1][p.x+1] == 'S' {
		return 1
	}
	if pts[p.y-1][p.x-1] == 'M' && pts[p.y+1][p.x-1] == 'M' && pts[p.y+1][p.x+1] == 'S' && pts[p.y-1][p.x+1] == 'S' {
		return 1
	}
	if pts[p.y+1][p.x-1] == 'M' && pts[p.y+1][p.x+1] == 'M' && pts[p.y-1][p.x+1] == 'S' && pts[p.y-1][p.x-1] == 'S' {
		return 1
	}

	return 0

}

